import React, { useState } from "react";
import { Link } from "react-router-dom";

function HomePage() {
  const [showForm, setShowForm] = useState(false);
  const [formData, setFormData] = useState({
    name: "",
    mobile: "",
    address: "",
    email: "",
  });

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  // ✅ Submit to backend API
  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await fetch("http://localhost:5000/api/emergency/create", {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify(formData),
      });

      const result = await response.json();

      if (response.ok) {
        alert("✅ Emergency request submitted successfully!");
        setShowForm(false);
        setFormData({ name: "", mobile: "", address: "", email: "" });
      } else {
        alert(result.message || "❌ Failed to submit request!");
      }
    } catch (error) {
      console.error("Error submitting form:", error);
      alert("⚠️ Server error! Please try again later.");
    }
  };

  return (
    <div className="snake-app">
      {/* Header */}
      <header className="navbar">
        <div className="navbar-brand">Snake Rescue Team</div>
        <div className="nav-buttons">
          <Link to="/login"><button className="login-btn">Login</button></Link>
          <Link to="/signup"><button className="getstarted-btn">Get Started</button></Link>
        </div>
      </header>

      {/* Hero */}
      <section className="hero">
        <h1>Snake Rescue Team<br />Jamshedpur</h1>
        <p>
          Professional snake rescue services with 24/7 emergency response.<br />
          Protecting communities through safe snake removal and wildlife conservation.
        </p>
        <button className="emergency-btn" onClick={() => setShowForm(true)}>
          Emergency Snake Rescue
        </button>
        <div className="emergency-desc">
          Available 24/7 · Response within 30 minutes
        </div>
      </section>

      {/* Popup Form */}
      {showForm && (
        <div className="popup-overlay">
          <div className="popup-form">
            <h2>Emergency Snake Rescue Form</h2>
            <form onSubmit={handleSubmit}>
              <label>
                Name:
                <input type="text" name="name" value={formData.name} onChange={handleChange} required />
              </label>
              <label>
                Mobile No:
                <input type="tel" name="mobile" value={formData.mobile} onChange={handleChange} required />
              </label>
              <label>
                Full Address:
                <textarea name="address" value={formData.address} onChange={handleChange} required></textarea>
              </label>
              <label>
                Email:
                <input type="email" name="email" value={formData.email} onChange={handleChange} required />
              </label>
              <div className="popup-buttons">
                <button type="submit" className="submit-btn">Submit</button>
                <button type="button" className="cancel-btn" onClick={() => setShowForm(false)}>Cancel</button>
              </div>
            </form>
          </div>
        </div>
      )}

      {/* (rest of the homepage unchanged) */}
    </div>
  );
}

export default HomePage;
